TCP/IP (Thông số thông tin, tất cả hình thức) là một dự án tích hợp dữ liệu truyền thông, qua Internet, và là một dạng nguyên lý của tất cả các liên hệ truy cập thấy trên thế giới dân gian. Dữ liệu truy cập vào Internet có sẵn dưới đường đầu tiên TCP (Transport Control Protocol), và có một số tên mẫu TCP/IP (Thông số thông tin, tất cả hình thức) khác nhau, như HTTP (Hypertext Transfer Protocol), FTP (File Transfer Protocol), SMTP (Simple Mail Transfer Protocol), DHCP (Dynamic Host Configuration Protocol).

Mỗi tầng của TCP/IP có sẵn một giao thức truy cập, và mà chúng ta xác định như:

TCP - Thiết bị: Client (Liên hệ) và Server (Duy nhất);
IP: Thiết bị IP: Client và Server;
Tcp: Thiết bị Tcp: Client và Server;
Port: Thiết bị Tcp: Client và Server.

HTTP - Thiết bị: Client (Liên hệ) và Server;
TCP: Thiết bị Tcp: Client và Server;
Port: Port HTTP 80.

FTP - Thiết bị: Client (Liên hệ) và Server;
TCP: Thiết bị Tcp: Client và Server;
Port: Port FTP 21.
